    <script>


            
        function openNav() {
            document.getElementById("mySidenav").style.width = "250px";
            $('#opener').fadeOut(500);
       }

        function closeNav() {
            document.getElementById("mySidenav").style.width = "0";
            $('#opener').fadeIn(1700);
        }


        // WALL

         $("input[name='wall1in']").change(function() {
            $("#wall1-svg").css("fill",$("input[name='wall1in']").val());
        });

 $("input[name='wall2in']").change(function() {
            $("#wall2-svg").css("fill",$("input[name='wall2in']").val());
        });

 $("input[name='wall3in']").change(function() {
            $("#wall3-svg").css("fill",$("input[name='wall3in']").val());
        });

 $("input[name='wall4in']").change(function() {
            $("#wall4-svg").css("fill",$("input[name='wall4in']").val());
        });

 $("input[name='ceilingin']").change(function() {
            $(".ceiling-svg").css("fill",$("input[name='ceilingin']").val());
        });




        /*-----------------------------------------------------------------*/


        let mouseBeginX = 0;
        let mouseBeginY = 0;

        // SOFA

        $("input[name='sofain']").change(function() {
            $("#sofa-svg").css("fill",$("input[name='sofain']").val());
        });

        function showsofa(){
            $('#sofa-closebtn').show();
             $('#sofa-svg').show();
             $('#sofa-png').show();
             $('#sofa-input').show();
             closeNav();
        }


        function hidesofa(){
            $('#sofa-closebtn').hide();
            $('#sofa-svg').hide();
             $('#sofa-png').hide();
             $('#sofa-input').hide();
        }
        let sofaMouseDown = false;
        $("#sofa-svg").mousedown(function (e) { 
            sofaMouseDown = true;
            mouseBeginX = e.pageX;
            mouseBeginY = e.pageY;
        });
       
        /*-----------------------------------------------------------------*/

        // LEFT CHAIR

        $("input[name='leftchairin']").change(function() {
            $("#leftchair-svg").css("fill",$("input[name='leftchairin']").val());
        });


        function showleftchair(){
            $('#leftchair-closebtn').show();
             $('#leftchair-svg').show();
             $('#leftchair-png').show();
             $('#leftchair-input').show();
             closeNav();
        }


        function hideleftchair(){
            $('#leftchair-closebtn').hide();
            $('#leftchair-svg').hide();
             $('#leftchair-png').hide();
             $('#leftchair-input').hide();
        }
        let leftchairMouseDown = false;
        $("#leftchair-svg").mousedown(function (e) { 
            leftchairMouseDown = true;
            mouseBeginX = e.pageX;
            mouseBeginY = e.pageY;
        });
       
       /*-----------------------------------------------------------------*/

        // RIGHT CHAIR

$("input[name='rightchairin']").change(function() {
            $("#rightchair-svg").css("fill",$("input[name='rightchairin']").val());
        });


        function showrightchair(){
            $('#rightchair-closebtn').show();
             $('#rightchair-svg').show();
             $('#rightchair-png').show();
             $('#rightchair-input').show();
             closeNav();
        }


        function hiderightchair(){
            $('#rightchair-closebtn').hide();
            $('#rightchair-svg').hide();
             $('#rightchair-png').hide();
             $('#rightchair-input').hide();
        }
        let rightchairMouseDown = false;
        $("#rightchair-svg").mousedown(function (e) { 
            rightchairMouseDown = true;
            mouseBeginX = e.pageX;
            mouseBeginY = e.pageY;
        });


 /*-----------------------------------------------------------------*/

        // TABLE

    $("input[name='tablein']").change(function() {
            $("#table-svg").css("fill",$("input[name='tablein']").val());
        });


        function showtable(){
            $('#table-closebtn').show();
             $('#table-svg').show();
             $('#table-png').show();
             $('#table-input').show();
             closeNav();
        }


        function hidetable(){
            $('#table-closebtn').hide();
            $('#table-svg').hide();
             $('#table-png').hide();
             $('#table-input').hide();
        }
        let tableMouseDown = false;
        $("#table-svg").mousedown(function (e) { 
            tableMouseDown = true;
            mouseBeginX = e.pageX;
            mouseBeginY = e.pageY;
        });


 /*------------------------------------------------------------------------------------------------------------------------------------------------------------*/

         $(document).mousemove(function (e) { 

            if(leftchairMouseDown){
               
                let newTop = parseInt($('#leftchair-svg').css('top'), 10) + (e.pageY - mouseBeginY);
                let newLeft = parseInt($('#leftchair-svg').css('left'), 10) + (e.pageX - mouseBeginX);
                
                if(newTop > 10 && newTop < 900 && newLeft > 10 && newLeft < 1600){
                    $('#leftchair-svg').css("top", newTop);
                    $('#leftchair-svg').css("left", newLeft);
                    $('#leftchair-png').css("top", newTop);
                    $('#leftchair-png').css("left", newLeft);
                    $('#leftchair-input').css("top", newTop+20);
                    $('#leftchair-input').css("left", newLeft-10);
                    $('#leftchair-closebtn').css("top", newTop);
                    $('#leftchair-closebtn').css("left", newLeft-7);
                }
                else {
                    leftchairMouseDown = false;
                }

                mouseBeginX = e.pageX;
                mouseBeginY = e.pageY;
            }

            if(rightchairMouseDown){
                
                    let newTop = parseInt($('#rightchair-svg').css('top'), 10) + (e.pageY - mouseBeginY);
                    let newLeft = parseInt($('#rightchair-svg').css('left'), 10) + (e.pageX - mouseBeginX);
                    
                    if(newTop > 10 && newTop < 900 && newLeft > 10 && newLeft < 1600){
                        $('#rightchair-svg').css("top", newTop);
                        $('#rightchair-svg').css("left", newLeft);
                        $('#rightchair-png').css("top", newTop);
                        $('#rightchair-png').css("left", newLeft);
                        $('#rightchair-input').css("top", newTop+10);
                        $('#rightchair-input').css("left", newLeft+197);
                        $('#rightchair-closebtn').css("top", newTop-10);
                        $('#rightchair-closebtn').css("left", newLeft+200);
                    }
                    else {
                        rightchairMouseDown = false;
                    }

                    mouseBeginX = e.pageX;
                    mouseBeginY = e.pageY;
             }

            if(sofaMouseDown){
                
                let newTop = parseInt($('#sofa-svg').css('top'), 10) + (e.pageY - mouseBeginY);
                let newLeft = parseInt($('#sofa-svg').css('left'), 10) + (e.pageX - mouseBeginX);
                
                if(newTop > 10 && newTop < 900 && newLeft > 10 && newLeft < 1600){
                    $('#sofa-svg').css("top", newTop);
                    $('#sofa-svg').css("left", newLeft);
                    $('#sofa-png').css("top", newTop);
                    $('#sofa-png').css("left", newLeft);
                    $('#sofa-input').css("top", newTop-17);
                    $('#sofa-input').css("left", newLeft+380);
                    $('#sofa-closebtn').css("top", newTop-20);
                    $('#sofa-closebtn').css("left", newLeft+400);
                }
                else {
                    sofaMouseDown = false;
                }
                mouseBeginX = e.pageX;
                mouseBeginY = e.pageY;
            }

         if(tableMouseDown){
                
                let newTop = parseInt($('#table-svg').css('top'), 10) + (e.pageY - mouseBeginY);
                let newLeft = parseInt($('#table-svg').css('left'), 10) + (e.pageX - mouseBeginX);
                
                if(newTop > 10 && newTop <900 && newLeft > 10 && newLeft < 1600){
                    $('#table-svg').css("top", newTop);
                    $('#table-svg').css("left", newLeft);
                    $('#table-png').css("top", newTop);
                    $('#table-png').css("left", newLeft);
                    $('#table-input').css("top", newTop+20);
                    $('#table-input').css("left", newLeft+207);
                    $('#table-closebtn').css("top", newTop);
                    $('#table-closebtn').css("left", newLeft+210);
                }
                else {
                    tableMouseDown = false;
                }
                mouseBeginX = e.pageX;
                mouseBeginY = e.pageY;
            }



        });


        $(document).mouseup(function () { 
            leftchairMouseDown = false;
            rightchairMouseDown = false;
            tableMouseDown = false;
            sofaMouseDown = false;
        });


        </script>


